behav_params(b) = corrs_params(Correlators(b))
function corrs_params(corrs::Correlators{Sax, Sby, Sabxy, T}) where {Sax, Sby, Sabxy, T <: AbstractFloat}
  @printf "rstd = %.2e CHSH = %.2e QBER = %.2e rho = %.2e\n" rstd(corrs) CHSH(corrs) QBER(corrs) maximum(maxcorrs(corrs))
end
function corrs_params(corrs::Correlators)
  r = rstd(corrs); S = CHSH(corrs); Q = QBER(corrs)
  println("rstd = $r CHSH = $S QBER = $Q") 
end

function test_wirings()
  testc = expt_corrs(0.85, 0.937, meas_corrs())
  testb = Behaviour(testc)
  print("Original: ")
  behav_params(testb)
  for c in 2:5
    andb = and_behav(c, testb)
    xorb = parity_behav(c, testb)
    andb_only13 = sel_and_behav(c, testb, [2], [1, 2])
    andb_only113 = sel_and_behav(c, testb, [2], [2])
    println("c = $c")
    print("AND: ")
    behav_params(andb)
    print("XOR: ")
    behav_params(xorb)
    print("AND x = 1, y = 3: ")
    behav_params(andb_only13)
    print("AND x = 1, y = 1,3: ")
    behav_params(andb_only113)
  end
end

